function Display (props) {
  const { numbers, display, number } = props
  const formatted = float(number).toLocaleString()

  return (
    <div className='display glass'>
      {formatted.toLocaleString() || '0'}
      <div className='preview'>{display.toLocaleString() || '0'}</div>
    </div>
  )
}

